import React, {Component} from 'react'

function Card() {
	return (
		<div className='basis-1/3 p-3 bg-neutral-400 rounded'>
			<div className='justify-center flex p-6 py-10 bg-neutral-100 rounded'>
				<span className='text-xl text-neutral-700 font-semibold'>IMG</span>
			</div>
			<div className='justify-center flex p-6'>
				<span className='text-xl text-neutral-700 font-semibold'>TEXT</span>
			</div>
		</div>
	);
}

class Home extends Component {
	render() {
		return (
			<div className='justify-center flex'>
				<div className='flex flex-row'>
					<Card />
					<Card />
					<Card />
				</div>
			</div>
		);
	}
}

export default Home;
